import React from "react";
import "./Navbar.css";
import LogoCC from "../../Assets/LogoCC.svg";
import LogoOSFIIR from "../../Assets/LogoOSFIIR.svg";

const Navbar = () => {
  return (
    <section className="navbarcontainer">
      <nav className="navbar">
        <div className="logocontainer">
          <div className="logoCadCraft"><img src={LogoCC} alt="CadCraft Logo" /></div>
          <div className="logoOSFIIR"><img src={LogoOSFIIR} alt="OSFIIR Logo" /></div>
        </div>  
        <ul className="nav-links">
          <li><a href="#home">Programări</a></li>
          <li><a href="#about">Programările mele</a></li>
          <li><a href="#program">Profil Echipă</a></li>
          <li><a href="#contact">Detalii Imprimante</a></li>
        </ul>
        <div className="user-profile"></div>
      </nav>
    </section>
    );
};

export default Navbar;
